import React from 'react';
import './index.css';
import OneNews from '../Items/OneNews';

const AkselNews = (props) => {
	
	return (  
		<div className='container news'>
			<div className='text-center mx-auto'>
				<h2>Tin Tức SynerLink</h2>
				<p className="news-text mx-auto mt-2"></p>
			</div>
			<div className="aksel_news-main">
				<div className="row">
					{props.news.map((news, index) => ( // Thêm index vào đây
						<OneNews key={index} news={news} /> // Thêm key={index} vào đây
					))}
				</div>
			</div>
		</div>
	)
}

export default AkselNews;
